import React from "react";
import styled from "styled-components";
import { Button as B } from "./Main.elements";
const getItSection = () => {
  const Container = styled.div`
    display: flex;
    background-color: var(--green);
    flex-direction: column;
    justify-content: center;
    align-items: center;
  `;
  const Row = styled.div`
    display: flex;
    gap: 0rem;
    flex-direction: ${({ col }) => col && "column"};
  `;
  const Button = styled(B)`
    padding: 0;
  `;
  return (
    <div>
      <Container>
        <Row>Get it on Playstore and download on Appstore</Row>
        <Row>
          {" "}
          <Button google={true}>
            <Row>
              <img src="images/googlePlay.svg" alt="" />
            </Row>
            <Row>
              <p>Get it on</p>
              <p>Play store</p>
            </Row>
          </Button>
          <Button>
            <Row>
              <img src="images/app.svg" alt="" />
            </Row>
            <Row>
              <p>Get it on</p>
              <p>App store</p>
            </Row>
          </Button>
        </Row>
      </Container>
    </div>
  );
};

export default getItSection;
